import{_ as a,o as e,c as i,R as l,af as t}from"./chunks/framework.iNKEMQtI.js";const m=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"my/index.md","filePath":"my/index.md","lastUpdated":1701769291000}'),r={name:"my/index.md"},o=l('<h2 id="努力成为想成为的那个人-yx年终总结" tabindex="-1">努力成为想成为的那个人 | yx年终总结 <a class="header-anchor" href="#努力成为想成为的那个人-yx年终总结" aria-label="Permalink to &quot;努力成为想成为的那个人 | yx年终总结&quot;">​</a></h2><p><img src="'+t+'" alt="加油"></p><p>​大家好，我是yx，一个热爱技术且乐于分享的人。</p><h3 id="为什么叫yx" tabindex="-1">为什么叫yx? <a class="header-anchor" href="#为什么叫yx" aria-label="Permalink to &quot;为什么叫yx?&quot;">​</a></h3><p>一是因为我名字的缩写，二是yx就像数学里面的坐标轴，喜欢数学，就这么简单。</p><h3 id="这一年我做了什么" tabindex="-1">这一年我做了什么？ <a class="header-anchor" href="#这一年我做了什么" aria-label="Permalink to &quot;这一年我做了什么？&quot;">​</a></h3><p>2020年是收获比较多的一年，也是这一年我开始认真做自己的职业规划，开始搭建了个人博客，分享一些前端知识给大家，开始在一些平台分享自己做的一些功能以及一些解决问题办法，也不在只专注于业务，开始看一些源码类似的东西（Vue2源码），了解底层的一些东西，在看源码的过程中学习作者对框架的一种设计思想，同时也做了一个自己的公众号（目前打算再优化一下排版，再挂二维码到博客上面），做了一个扫码点餐的开源项目</p><blockquote><p>年初还是个只会写业务的小白，后面因为一次心血来潮，想搭建个的组件库，但是写了一会儿感觉架构设计的不是很好，就想着去看下element的源码，然后看了之后有些组件的设计我感觉也不是很好，又去看了iview,后面有了这次经验，就陷入了源码的坑，后面又因为公司有些活动页很相似，便想写个可视化编辑器，就联想到了vue的模板解析，便去看了底层是如何解析的，并买了一本深入浅出vue结合源码一起看，后面陆续又看了node/express的一些源码， 后面到新出的vue3，一直在不断的学习中。</p></blockquote><h4 id="技术栈不断完善" tabindex="-1">技术栈不断完善 <a class="header-anchor" href="#技术栈不断完善" aria-label="Permalink to &quot;技术栈不断完善&quot;">​</a></h4><ul><li>TypeScript</li><li>Node.js</li><li>Vue3</li><li>react</li></ul><h3 id="收获" tabindex="-1">收获 <a class="header-anchor" href="#收获" aria-label="Permalink to &quot;收获&quot;">​</a></h3><p><strong>为什么写博客</strong></p><p>写博客不仅可以让更多的人知道你，更多的人看到你的文章，提升自己的影响力，还能提升自己的技术，发文后会收到赞许，也会收到批评，批评会让你不断完善。俗话说好记性不如烂笔头，写博客也是一种记录的形式。</p><p>写博客与学习笔记还是有些差别的，笔记大多情况只是留给自己看，如果懒，就可能会不写，而写博客则可以收获到评价和大家一起进步，有时候还会收获一些一起学习的朋友。</p><p><strong>深挖一些不变的东西，不要只停留在表面</strong></p><p>对工作三年及其三年以上的技术人员就不能只停留在如何使用，不仅要又广度，也要有深度，要深挖一些底层的东西，不能只停留在表面，这样会被淘汰掉。</p><p><strong>尝试开拓视野</strong></p><p>多读书，多旅行，多关注一下自己的兴趣，让自己不断进步。你会发现比你优秀的人都在拼命努力，你没有任何 理由停滞不前。</p><h3 id="展望2021" tabindex="-1">展望2021 <a class="header-anchor" href="#展望2021" aria-label="Permalink to &quot;展望2021&quot;">​</a></h3><h4 id="技术提升" tabindex="-1">技术提升 <a class="header-anchor" href="#技术提升" aria-label="Permalink to &quot;技术提升&quot;">​</a></h4><ul><li>重学数据结构和算法</li><li>TypeScript，Vue3 实践更多一些</li><li>React实践更多一些</li><li>Node.js 深入学习</li><li>前端工程化学习</li><li>部署运维知识学习</li></ul><h4 id="生活" tabindex="-1">生活 <a class="header-anchor" href="#生活" aria-label="Permalink to &quot;生活&quot;">​</a></h4><ul><li>练习瑜伽</li><li>学习理财</li><li>考取数学教资（以后有空闲时间就去支教）</li><li>写一些短篇小说</li><li>做做手工</li></ul><h4 id="要坚持的事" tabindex="-1">要坚持的事 <a class="header-anchor" href="#要坚持的事" aria-label="Permalink to &quot;要坚持的事&quot;">​</a></h4><ul><li>在掘金写文章</li><li>做我的公众号【前端成长指引】</li><li>做几个自己的开源项目</li></ul><h3 id="最后" tabindex="-1">最后 <a class="header-anchor" href="#最后" aria-label="Permalink to &quot;最后&quot;">​</a></h3><p>2021新的开始，愿大家都可以成为自己想要成为的人。如果喜欢可以收藏，后期公众号调整好了，会发出二维码，一起共同进步。</p>',27),n=[o];function h(s,d,c,p,u,_){return e(),i("div",null,n)}const b=a(r,[["render",h]]);export{m as __pageData,b as default};
